import Layout from "../components/Layout";

class Retrive extends React.Component {
  render() {
    return (
      <Layout>
        <div>
          <h1>Data from the Mongo DB Database</h1>
          <p>Storing song_name and score </p>
        </div>
      </Layout>
    );
  }
}

export default Retrive;
